      y de fundamentar la dignidad de la persona.</li>\r\n\t<li>Conocer y asimilar
      los fundamentos antropol&oacute;gicos, que sustentan los grandes principios
      de la labor educativa, especialmente los que se fundamentan en el mensaje cristiano.</li>\r\n\t<li>An&aacute;lisis
      y s&iacute;ntesis de las realidades sociales y corrientes de pensamiento que
      afectan al devenir hist&oacute;rico de la Humanidad, que se fundamentan en el
      mensaje cristiano.</li>\r\n\t<li>Conocer las orientaciones que, desde la antropolog&iacute;a
      cristiana se ofrecen para las cuestiones sociales, y en especial para todo lo
      que se refiere a la familia y la educaci&oacute;n.</li>\r\n\t<li>Analizar el
      complejo mundo de las relaciones sociales que condicionan el destino del hombre,
      tratando de dar un sentido a la existencia y al misterio que envuelve a la Humanidad.</li>\r\n\t<li>Analizar
      las distintas propuestas y soluciones que se dan a la cuesti&oacute;n social,
      haciendo hincapi&eacute; en la perspectiva social del Magisterio.</li>\r\n\t<li>Conciencia
      cr&iacute;tica de la existencia de una trascendencia y su vivencia en el hecho
      religioso.</li>\r\n\t<li>Conocimiento sistem&aacute;tico del hecho religioso
      en las diversas culturas, as&iacute; como su influencia social, &eacute;tica
      y cultural.</li>\r\n\t<li>Conciencia de y respecto hacia las religiones de otras
      culturas.</li>\r\n\t<li>Capacidad para identificar y comprender el significado
      del lenguaje religioso como modo de expresar lo inefable.</li>\r\n\t<li>Conciencia
      cr&iacute;tica de la relaci&oacute;n inextricable entre una creencia y su praxis.</li>\r\n\t<li>Conocimiento
      de la centralidad de la figura de Jesucristo en el mensaje y la moral cristiana.</li>\r\n\t<li>Conocimiento
      detallado de los contenidos esenciales de la Fe cristiana.</li>\r\n\t<li>Conocer
      el valor de la familia cristiana como sustento de procesos educativos y como
      &aacute;mbito de excelencia para el crecimiento arm&oacute;nico.</li>\r\n\t<li>Conocer
      los fundamentos antropol&oacute;gicos de la tarea educativa.</li>\r\n</ul>"
- model: dbschema.titulacionhtml
  pk: 2
  fields:
    created_on: 2022-10-03 14:47:33.622452+00:00
    updated_on: 2022-10-03 14:57:36.343772+00:00
