    grupo: Competencias
    titulo: Específicas
    texto: "<h4>Comunes</h4>\r\n\r\n<ul>\r\n\t<li>Conocer los objetivos, contenidos
      curriculares y criterios de evaluaci&oacute;n de la Educaci&oacute;n Infantil.</li>\r\n\t<li>Promover
      y facilitar los aprendizajes en la primera infancia, desde una perspectiva globalizadora
      e integradora de las diferentes dimensiones cognitiva, emocional, psicomotora
      y volitiva.</li>\r\n\t<li>Dise&ntilde;ar y regular espacios de aprendizaje en
      contextos de diversidad que atiendan a las singulares necesidades educativas
      de los estudiantes, a la igualdad de g&eacute;nero, a la equidad y al respeto
      a los derechos humanos.</li>\r\n\t<li>Fomentar la convivencia en el aula y fuera
      de ella y abordar la resoluci&oacute;n pac&iacute;fica de conflictos. Saber
      observar sistem&aacute;ticamente contextos de aprendizaje y convivencia y saber
      reflexionar sobre ellos.</li>\r\n\t<li>Reflexionar en grupo sobre la aceptaci&oacute;n
      de normas y el respeto a los dem&aacute;s. Promover la autonom&iacute;a y la
      singularidad de cada estudiante como factores de educaci&oacute;n de las emociones,
      los sentimientos y los valores en la primera infancia.</li>\r\n\t<li>Conocer
      la evoluci&oacute;n del lenguaje en la primera infancia, saber identificar posibles
      disfunciones y velar por su correcta evoluci&oacute;n. Abordar con eficacia
      situaciones de aprendizaje de lenguas en contextos multiculturales y multiling&uuml;es.
      Expresarse oralmente y por escrito y dominar el uso de diferentes t&eacute;cnicas
      de expresi&oacute;n.</li>\r\n\t<li>Conocer las implicaciones educativas de las
      tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n y, en particular,
      de la televisi&oacute;n en la primera infancia.</li>\r\n\t<li>Conocer fundamentos
      de diet&eacute;tica e higiene infantiles. Conocer fundamentos de atenci&oacute;n
      temprana y las bases y desarrollos que permiten comprender los procesos psicol&oacute;gicos,
      de aprendizaje y de construcci&oacute;n de la personalidad en la primera infancia.</li>\r\n\t<li>Conocer
      la organizaci&oacute;n de las escuelas de educaci&oacute;n infantil y la diversidad
      de acciones que comprende su funcionamiento. Asumir que el ejercicio de la funci&oacute;n
      docente ha de ir perfeccion&aacute;ndose y adapt&aacute;ndose a los cambios
      cient&iacute;ficos, pedag&oacute;gicos y sociales a lo largo de la vida.</li>\r\n\t<li>Actuar
      como orientador de padres y madres en relaci&oacute;n con la educaci&oacute;n
      familiar en el periodo 0-6 y dominar habilidades sociales en el trato y relaci&oacute;n
      con la familia de cada estudiante y con el conjunto de las familias.</li>\r\n\t<li>Reflexionar
      sobre las pr&aacute;cticas de aula para innovar y mejorar la labor docente.
      Adquirir h&aacute;bitos y destrezas para el aprendizaje aut&oacute;nomo y cooperativo
      y promoverlo en los estudiantes.</li>\r\n\t<li>Comprender la funci&oacute;n,
      las posibilidades y los l&iacute;mites de la educaci&oacute;n en la sociedad
      actual y las competencias fundamentales que afectan a los colegios de educaci&oacute;n
      infantil y a sus profesionales. Conocer modelos de mejora de la calidad con
      aplicaci&oacute;n a los centros educativos.</li>\r\n\t<li>Comprender los procesos
      educativos y de aprendizaje en el periodo 0-6, en el contexto familiar, social
      y escolar.</li>\r\n\t<li>Conocer los desarrollos de la psicolog&iacute;a evolutiva
      de la infancia en los periodos 0-3 y 3-6.</li>\r\n\t<li>Conocer los fundamentos
      de atenci&oacute;n temprana.</li>\r\n\t<li>Reconocer la identidad de la etapa
      y sus caracter&iacute;sticas cognitivas, psicomotoras, comunicativas, sociales,
      afectivas.</li>\r\n\t<li>Saber promover la adquisici&oacute;n de h&aacute;bitos
      en torno a la autonom&iacute;a, la libertad, la curiosidad, la observaci&oacute;n,
      la experimentaci&oacute;n, la imitaci&oacute;n, la aceptaci&oacute;n de normas
      y de l&iacute;mites, el juego simb&oacute;lico y heur&iacute;stico.</li>\r\n\t<li>Conocer
      la dimensi&oacute;n pedag&oacute;gica de la interacci&oacute;n con los iguales
      y los adultos y saber promover la participaci&oacute;n en actividades colectivas,
      el trabajo cooperativo y el esfuerzo individual.</li>\r\n\t<li>Identificar dificultades
      de aprendizaje, disfunciones cognitivas y las relacionadas con la atenci&oacute;n.</li>\r\n\t<li>Saber
      informar a otros profesionales especialistas para abordar la colaboraci&oacute;n
      del centro y del maestro en la atenci&oacute;n a las necesidades educativas
      especiales que se planteen.</li>\r\n\t<li>Adquirir recursos para favorecer la
      integraci&oacute;n educativa de estudiantes con dificultades.</li>\r\n\t<li>Crear
      y mantener lazos de comunicaci&oacute;n con las familias para incidir eficazmente
      en el proceso educativo.</li>\r\n\t<li>Conocer y saber ejercer las funciones
      de tutor y orientador en relaci&oacute;n con la educaci&oacute;n familiar.</li>\r\n\t<li>Promover
      y colaborar en acciones dentro y fuera de la escuela, organizadas por familias,
      ayuntamientos y otras instituciones con incidencia en la formaci&oacute;n ciudadana.</li>\r\n\t<li>Analizar
      e incorporar de forma cr&iacute;tica las cuestiones m&aacute;s relevantes de
      la sociedad actual que afectan a la educaci&oacute;n familiar y escolar: impacto
      social y educativo de los lenguajes audiovisuales y de las pantallas; cambios
      en las relaciones de g&eacute;nero e intergeneracionales; multiculturalidad
      e interculturalidad; discriminaci&oacute;n e inclusi&oacute;n social y desarrollo
      sostenible.</li>\r\n\t<li>Conocer la evoluci&oacute;n hist&oacute;rica de la
      familia, los diferentes tipos de familias, de estilos de vida y educaci&oacute;n
      en el contexto familiar.</li>\r\n\t<li>Conocer los principios b&aacute;sicos
      de un desarrollo y comportamiento saludables.</li>\r\n\t<li>Identificar trastornos
      en el sue&ntilde;o, la alimentaci&oacute;n, el desarrollo psicomotor, la atenci&oacute;n
      y la percepci&oacute;n auditiva y visual.</li>\r\n\t<li>Colaborar con los profesionales
      especializados para solucionar dichos trastornos.</li>\r\n\t<li>Detectar carencias
      afectivas, alimenticias y de bienestar que perturben el desarrollo f&iacute;sico
      y ps&iacute;quico adecuado de los estudiantes.</li>\r\n\t<li>Comprender que
      la din&aacute;mica diaria en educaci&oacute;n infantil es cambiante en funci&oacute;n
      de cada estudiante, grupo y situaci&oacute;n, y saber ser flexible en el ejercicio
      de la funci&oacute;n docente.</li>\r\n\t<li>Valorar la importancia de la estabilidad
      y la regularidad en el entorno escolar, los horarios y los estados de &aacute;nimo
      del profesorado como factores que contribuyen al progreso arm&oacute;nico e
      integral de los estudiantes.</li>\r\n\t<li>Saber trabajar en equipo con otros
      profesionales de dentro y fuera del centro en la atenci&oacute;n a cada estudiante,
      as&iacute; como en la planificaci&oacute;n de las secuencias de aprendizaje
      y en la organizaci&oacute;n de las situaciones de trabajo en el aula y en el
      espacio de juego, identificando las peculiaridades del periodo 0-3 y del periodo
      3-6.</li>\r\n\t<li>Atender las necesidades de los estudiantes y transmitir seguridad,
      tranquilidad y afecto.</li>\r\n\t<li>Comprender que la observaci&oacute;n sistem&aacute;tica
      es un instrumento b&aacute;sico para poder reflexionar sobre la pr&aacute;ctica
      y la realidad, as&iacute; como contribuir a la innovaci&oacute;n y a la mejora
      en educaci&oacute;n infantil.</li>\r\n\t<li>Dominar las t&eacute;cnicas de observaci&oacute;n
      y registro.</li>\r\n\t<li>Abordar an&aacute;lisis de campo mediante metodolog&iacute;a
      observacional utilizando tecnolog&iacute;as de la informaci&oacute;n, documentaci&oacute;n
      y audiovisuales.</li>\r\n\t<li>Saber analizar los datos obtenidos, comprender
      cr&iacute;ticamente la realidad y elaborar un informe de conclusiones.</li>\r\n\t<li>Situar
      la escuela infantil en el sistema educativo espa&ntilde;ol, en el contexto europeo
      y en el internacional.</li>\r\n\t<li>Conocer experiencias internacionales y
      ejemplos de pr&aacute;cticas de innovadoras en educaci&oacute;n infantil.</li>\r\n\t<li>Valorar
      la importancia del trabajo en equipo.</li>\r\n\t<li>Participar en la elaboraci&oacute;n
      y seguimiento de proyectos educativos de educaci&oacute;n infantil en el marco
      de proyectos de centro y en colaboraci&oacute;n con el territorio y con otros
      profesionales y agentes sociales.</li>\r\n\t<li>Conocer la legislaci&oacute;n
      que regula las escuelas infantiles y su organizaci&oacute;n.</li>\r\n\t<li>Valorar
      la relaci&oacute;n personal con cada estudiante y su familia como factor de
      calidad de la educaci&oacute;n.</li>\r\n\t<li>Conocer los fundamentos cient&iacute;ficos,
      matem&aacute;ticos y tecnol&oacute;gicos del curr&iacute;culo de esta etapa
      as&iacute; como las teor&iacute;as sobre la adquisici&oacute;n y desarrollo
      de los aprendizajes correspondientes.</li>\r\n\t<li>Conocer estrategias did&aacute;cticas
      para desarrollar representaciones num&eacute;ricas y nociones espaciales, geom&eacute;tricas
      y de desarrollo l&oacute;gico.</li>\r\n\t<li>Comprender las matem&aacute;ticas
      como conocimiento sociocultural.</li>\r\n\t<li>Conocer la metodolog&iacute;a
      cient&iacute;fica y promover el pensamiento cient&iacute;fico y la experimentaci&oacute;n.</li>\r\n\t<li>Adquirir
      conocimientos sobre la evoluci&oacute;n del pensamiento, las costumbres, las
      creencias y los movimientos sociales y pol&iacute;ticos a lo largo de la historia.</li>\r\n\t<li>Conocer
      los momentos m&aacute;s sobresalientes de la historia de las ciencias y las
      t&eacute;cnicas y su trascendencia.</li>\r\n\t<li>Elaborar propuestas did&aacute;cticas
      en relaci&oacute;n con la interacci&oacute;n ciencia, t&eacute;cnica, sociedad
      y desarrollo sostenible.</li>\r\n\t<li>Promover el inter&eacute;s y el respeto
      por el medio natural, social y cultural a trav&eacute;s de proyectos did&aacute;cticos
      adecuados.</li>\r\n\t<li>Fomentar experiencias de iniciaci&oacute;n a las tecnolog&iacute;as
      de la informaci&oacute;n y la comunicaci&oacute;n.</li>\r\n\t<li>Conocer el
      curr&iacute;culo de lengua y lectoescritura de esta etapa as&iacute; como las
      teor&iacute;as sobre la adquisici&oacute;n y desarrollo de los aprendizajes
      correspondientes.</li>\r\n\t<li>Favorecer las capacidades de habla y de escritura.</li>\r\n\t<li>Conocer
      y dominar t&eacute;cnicas de expresi&oacute;n oral y escrita.</li>\r\n\t<li>Conocer
      la tradici&oacute;n oral y el folklore.</li>\r\n\t<li>Comprender el paso de
      la oralidad a la escritura y conocer los diferentes registros y usos de la lengua.</li>\r\n\t<li>Conocer
      el proceso de aprendizaje de la lectura y la escritura y su ense&ntilde;anza.</li>\r\n\t<li>Afrontar
      situaciones de aprendizaje de lenguas en contextos multiling&uuml;es.</li>\r\n\t<li>Reconocer
      y valorar el uso adecuado del lenguaje verbal y no verbal.</li>\r\n\t<li>Conocer
      y utilizar adecuadamente recursos para la animaci&oacute;n a la lectura y a
      la escritura.</li>\r\n\t<li>Adquirir formaci&oacute;n literaria y en especial
      conocer la literatura infantil.</li>\r\n\t<li>Ser capaz de fomentar una primera
      aproximaci&oacute;n a una lengua extranjera.</li>\r\n\t<li>Expresarse, oralmente
      y por escrito en una lengua extranjera.</li>\r\n\t<li>Conocer los fundamentos
      musicales, pl&aacute;sticos y de expresi&oacute;n corporal del curr&iacute;culo
      de esta etapa as&iacute; como las teor&iacute;as sobre la adquisici&oacute;n
      y desarrollo de los aprendizajes correspondientes.</li>\r\n\t<li>Conocer y utilizar
      canciones para promover la educaci&oacute;n auditiva, r&iacute;tmica y vocal.</li>\r\n\t<li>Saber
      utilizar el juego como recurso did&aacute;ctico, as&iacute; como dise&ntilde;ar
      actividades de aprendizaje basadas en principios l&uacute;dicos.</li>\r\n\t<li>Elaborar
      propuestas did&aacute;cticas que fomenten la percepci&oacute;n y expresi&oacute;n
      musicales, las habilidades motrices, el dibujo y la creatividad.</li>\r\n\t<li>Analizar
      los lenguajes audiovisuales y sus implicaciones educativas.</li>\r\n\t<li>Promover
      la sensibilidad relativa a la expresi&oacute;n pl&aacute;stica y a la creaci&oacute;n
      art&iacute;stica.</li>\r\n\t<li>Adquirir un conocimiento pr&aacute;ctico del
      aula y de la gesti&oacute;n de la misma.</li>\r\n\t<li>Conocer y aplicar los
      procesos de interacci&oacute;n y comunicaci&oacute;n en el aula, as&iacute;
      como dominar las destrezas y habilidades sociales necesarias para fomentar un
      clima que facilite el aprendizaje y la convivencia.</li>\r\n\t<li>Controlar
      y hacer el seguimiento del proceso educativo y, en particular, de ense&ntilde;anza
      y aprendizaje mediante el dominio de t&eacute;cnicas y estrategias necesarias.</li>\r\n\t<li>Relacionar
      teor&iacute;a y pr&aacute;ctica con la realidad del aula y del centro.</li>\r\n\t<li>Participar
      en la actividad docente y aprender a saber hacer, actuando y reflexionando desde
      la pr&aacute;ctica.</li>\r\n\t<li>Participar en las propuestas de mejora en
      los distintos &aacute;mbitos de actuaci&oacute;n que se puedan establecer en
      un centro.</li>\r\n\t<li>Regular los procesos de interacci&oacute;n y comunicaci&oacute;n
      en grupos de estudiantes de 0-3 a&ntilde;os y de 3-6 a&ntilde;os.</li>\r\n\t<li>Conocer
      formas de colaboraci&oacute;n con los distintos sectores de la comunidad educativa
      y del entorno social.</li>\r\n</ul>\r\n\r\n<hr />\r\n<h4>Menci&oacute;n Lengua
      Extranjera: Ingl&eacute;s y Aprendizaje de lenguas (aplicables tambi&eacute;n
      a la intensificaci&oacute;n en Valenciano)</h4>\r\n\r\n<ul>\r\n\t<li>Comprender
      situaciones habituales de comunicaci&oacute;n emitidas de forma oral&nbsp; y
      escrita en otras lenguas (extranjera o cooficial).</li>\r\n\t<li>Conocer las
      principales corrientes did&aacute;cticas de la ense&ntilde;anza de lenguas extranjeras
      y de segunda lengua a ni&ntilde;os y su aplicaci&oacute;n al aula de lengua
      inglesa en los distintos niveles establecidos en el curr&iacute;culo.</li>\r\n\t<li>Disponer
      de plena competencia as&iacute; como de un buen conocimiento ling&uuml;&iacute;stico
      y socio-cultural de la lengua extranjera que se imparte (Ingl&eacute;s).</li>\r\n\t<li>Comprender,
      producir y analizar discursos orales y escritos en ingl&eacute;s con adecuaci&oacute;n,
      coherencia, cohesi&oacute;n y correcci&oacute;n gramatical.</li>\r\n\t<li>Expresarse
      oralmente y por escrito en ingl&eacute;s mediante textos coherentes, cohesionados,
      correctos gramaticalmente y adecuados a situaciones acad&eacute;micas o cotidianas.</li>\r\n\t<li>Erradicar
      de las propias producciones los usos ling&uuml;&iacute;sticos que manifiestan
      discriminaci&oacute;n hacia las personas o los grupos sociales.</li>\r\n\t<li>Reconocer
      el hecho de que el desarrollo de la competencia comunicativa en una lengua s&oacute;lo
      se puede realizar mediante su uso.</li>\r\n\t<li>Utilizar el ingl&eacute;s para
      la obtenci&oacute;n y reelaboraci&oacute;n de la informaci&oacute;n, como instrumento
      para la revisi&oacute;n y la adquisici&oacute;n de nuevos aprendizajes.</li>\r\n\t<li>Interpretar
      y valorar las obras relevantes de la tradici&oacute;n literaria en inter&eacute;s
      e interpretar textos literarios infantiles actuales.</li>\r\n\t<li>Reflexionar
      sobre los mecanismos del ingl&eacute;s en los planos fonol&oacute;gico, morfosint&aacute;ctico,
      l&eacute;xico sem&aacute;ntico y textual y aplicar esta reflexi&oacute;n a la
      regulaci&oacute;n de las producciones propias.</li>\r\n\t<li>Reconocer la variaci&oacute;n
      como hecho consustancial a todas las lenguas y analizar cr&iacute;ticamente
      los diversos usos sociales de las lenguas de nuestro entorno.</li>\r\n\t<li>Desarrollar
      actitudes positivas hacia el uso de otras lenguas en todos los &aacute;mbitos
      de uso, especialmente en el escolar.</li>\r\n\t<li>Analizar la situaci&oacute;n
      social a partir del fen&oacute;meno del contacto de lenguas.</li>\r\n\t<li>Valorar
      el papel fundamental de la escuela en el conocimiento de las lenguas.</li>\r\n\t<li>Conocer
      la organizaci&oacute;n general del sistema educativo valenciano y el marco legal
      por lo que respecta a las lenguas, con una atenci&oacute;n especial a los programas,
      as&iacute; como los documentos de planificaci&oacute;n de centro que los desarrollan.</li>\r\n\t<li>Saber
      c&oacute;mo se articulan las medidas necesarias organizativas y did&aacute;cticas
      para conseguir los objetivos ling&uuml;&iacute;sticos prescritos mediante la
      aplicaci&oacute;n de los fundamentos de la adquisici&oacute;n de lenguas a cada
      contexto, la planificaci&oacute;n del proceso y la diversificaci&oacute;n del
      tratamiento de la L1 (lengua primera), la L2 (lengua segunda) y la LE (lengua
      extranjera).</li>\r\n\t<li>Conocer y aplicar los recursos ling&uuml;&iacute;sticos
      y did&aacute;cticos que las TIC (Tecnolog&iacute;as de la Informaci&oacute;n
      y la Comunicaci&oacute;n) han aportado a la ense&ntilde;anza &nbsp;aprendizaje,
      especialmente al de lenguas.</li>\r\n\t<li>Conocer y aplicar las orientaciones
      contenidas en el MCER, as&iacute; como los instrumentos que se derivan en la
      propia acci&oacute;n educativa, de acuerdo con el aprendizaje de lenguas en
      el marco legal, especialmente los curr&iacute;culos que organizan el sistema
      educativo valenciano.</li>\r\n\t<li>Dise&ntilde;ar situaciones y dispositivos
      de ense&ntilde;anza &nbsp;aprendizaje adecuados a las necesidades ling&uuml;&iacute;sticas
      del alumnado, intentando superar estereotipos ling&uuml;&iacute;sticos.</li>\r\n\t<li>&nbsp;Desarrollar,
      a partir del conocimiento de la complejidad de los aspectos implicados en el
      tratamiento did&aacute;ctico de las habilidades ling&uuml;&iacute;sticas, la
      programaci&oacute;n, dise&ntilde;o y valoraci&oacute;n cr&iacute;tica de actividades
      para el aprendizaje ling&uuml;&iacute;stico desde la perspectiva de una educaci&oacute;n
      pluriling&uuml;e, conociendo las implicaciones did&aacute;cticas de las principales
      corrientes metodol&oacute;gicas en la educaci&oacute;n ling&uuml;&iacute;stica.</li>\r\n\t<li>Producir
      discursos en una variedad formal, especialmente los habituales en los &aacute;mbitos
      educativo y acad&eacute;mico con el objetivo de gestionar la acci&oacute;n did&aacute;ctica
      y las relaciones sociales y administrativas en el centro.</li>\r\n\t<li>Tener
      en las lenguas vehiculares del curr&iacute;culo el nivel de competencia necesario
      como lenguas instrumentales del &aacute;mbito educativo, que permita al alumnado
      producir discursos orales y escritos, coherentes, cohesionados y adecuados a
      las diferentes situaciones de comunicaci&oacute;n que se producen en el aula
      y en el centro.</li>\r\n</ul>\r\n\r\n<hr />\r\n<h4>Menci&oacute;n Orientaci&oacute;n
      y tutor&iacute;a</h4>\r\n\r\n<ul>\r\n\t<li>Capacidad para desempe&ntilde;ar
      las funciones de tutor&iacute;a y de orientaci&oacute;n con los estudiantes
      y sus familias, atendiendo las necesidades educativas singulares y coordinando
      la acci&oacute;n educativa referida a su grupo de alumnos.</li>\r\n\t<li>Dise&ntilde;ar,
      planificar y evaluar procesos de ense&ntilde;anza y aprendizaje para alumnos
      en situaci&oacute;n de riesgo social o fracaso escolar, tanto individualmente
      como en colaboraci&oacute;n con otros docentes y profesionales del centro.</li>\r\n\t<li>Capacidad
      para dise&ntilde;ar y desarrollar proyectos educativos y unidades de programaci&oacute;n
      que permitan adaptar el curr&iacute;culo al contexto de las necesidades espec&iacute;ficas
      y los contextos socio-culturales de los alumnos.</li>\r\n\t<li>Saber utilizar
      adecuadamente en las actividades de ense&ntilde;anza-aprendizaje, las nuevas
      tecnolog&iacute;as y otros recursos espec&iacute;ficos para diversas necesidades
      del alumnado, as&iacute; como recursos t&eacute;cnicos que faciliten el acceso
      a la informaci&oacute;n y la comunicaci&oacute;n.</li>\r\n\t<li>Capacidad para
      preparar, seleccionar y construir materiales did&aacute;cticos y aplicarlos
      en los marcos espec&iacute;ficos de las distintas disciplinas.</li>\r\n\t<li>Capacidad
      para promover el aprendizaje aut&oacute;nomo de los alumnos en funci&oacute;n
      de los objetivos y contenidos adecuados a su nivel educativo y caracter&iacute;sticas
      de aprendizaje.</li>\r\n\t<li>Capacidad para organizar, planificar y adaptar
      los procesos de ense&ntilde;anza-aprendizaje, utilizando de forma integrada
      los diferentes saberes disciplinares y transversales adecuados a las caracter&iacute;sticas
      de aprendizaje del alumno.</li>\r\n\t<li>Capacidad para promover la adecuaci&oacute;n
      de los contextos educativos (aula y centro) de modo que se garanticen la accesibilidad
      y el bienestar.</li>\r\n\t<li>Capacidad para realizar actividades educativas
      de apoyo en el marco de una educaci&oacute;n inclusiva.</li>\r\n\t<li>Capacidad
      para analizar situaciones familiares concretas junto con las habilidades sociales
      necesarias para trabajar conjuntamente con los padres en la educaci&oacute;n
      del alumno.</li>\r\n\t<li>Capacidad para colaborar con los distintos sectores
      de la comunidad educativa y del entorno, promoviendo la integraci&oacute;n social
      de los alumnos en situaciones de riesgo social, desarrollando estrategias que
      eviten la exclusi&oacute;n y la discriminaci&oacute;n del alumno.</li>\r\n\t<li>Desarrollar
      habilidades para promover actitudes de respeto a las diferencias personales
      y culturales de los alumnos y dem&aacute;s miembros de la comunidad educativa.</li>\r\n\t<li>Dise&ntilde;ar
      y regular espacios de aprendizaje en contextos de diversidad que atiendan a
      la igualdad de g&eacute;nero, a la equidad y al respeto a los derechos humanos
      que conforman los valores de la formaci&oacute;n ciudadana.</li>\r\n\t<li>Alcanzar
      una comprensi&oacute;n y conocimiento del &aacute;mbito familiar que permita
      al maestro aplicar en cada circunstancia la mejor estrategia de apoyo a la educaci&oacute;n
      en el contexto familiar.</li>\r\n\t<li>Desarrollar habilidad para promover una
      cooperaci&oacute;n efectiva entre las familias y el centro educativo.</li>\r\n\t<li>Adquirir
      los conocimientos necesarios y las habilidades pr&aacute;cticas para dise&ntilde;ar
      e implementar una escuela de padres en el centro escolar, as&iacute; como otros
      programas de formaci&oacute;n familiar.</li>\r\n\t<li>Desarrollar destrezas
      de aplicaci&oacute;n de las diferentes metodolog&iacute;as y programas de orientaci&oacute;n
      y tutor&iacute;a en el &aacute;mbito escolar.</li>\r\n</ul>\r\n\r\n<hr />\r\n<h4>Intensificaci&oacute;n
      en Aprendizaje y Did&aacute;ctica de la Religi&oacute;n</h4>\r\n\r\n<ul>\r\n\t<li>Capacidad
      para plantearse preguntas sobre el sentido &uacute;ltimo de la vida.</li>\r\n\t<li>Capacidad
      para leer y comprender el lenguaje religioso y especialmente el contenido de
      la Biblia en sus diversos libros, especialmente los del Antiguo Testamento y
      conocimiento de la Teolog&iacute;a b&iacute;blica.</li>\r\n\t<li>Capacidad para
      comprender y utilizar el lenguaje t&eacute;cnico teol&oacute;gico.</li>\r\n\t<li>Conocimiento
      de las exigencias morales de la persona a la luz del mensaje cristiano.</li>\r\n\t<li>Conciencia
      de la conexi&oacute;n entre la creencia cristiana y su vivencia en la comunidad
      eclesial.</li>\r\n\t<li>Capacidad para captar y comprender el significado profundo
      de los signos sacramentales.</li>\r\n\t<li>Conciencia del papel del profesor
      de religi&oacute;n como enviado de la Iglesia para insertar el Evangelio en
      el coraz&oacute;n de la cultura.</li>\r\n\t<li>Capacidad de situar la ense&ntilde;anza
      religiosa escolar en el conjunto de la actividad educativa de la escuela.</li>\r\n\t<li>Habilidad
      para adoptar el talante, el carisma y la creatividad necesarios para la ense&ntilde;anza
      religiosa.</li>\r\n\t<li>Conocimiento sistem&aacute;tico de la psicolog&iacute;a
      evolutiva infantil de 3 a 6 a&ntilde;os, especialmente en cuanto a la capacidad
      de trascendencia.</li>\r\n\t<li>Habilidad pedag&oacute;gica para la aplicaci&oacute;n
      del curr&iacute;culo de religi&oacute;n en el nivel educativo infantil.</li>\r\n\t<li>Capacidad
      para la aplicaci&oacute;n y utilizaci&oacute;n de los m&eacute;todos e instrumentos
      adecuados a la ense&ntilde;anza de los contenidos teol&oacute;gicos en educaci&oacute;n
      infantil.</li>\r\n</ul>"
