    titulo: Tasas académicas
    texto: "<div>\r\n<h2>Tasas acad&eacute;micas</h2>\r\n\r\n<ul>\r\n\t<li><a href=\"/docs/nuevo-alumno/tasas-academicas/grado/facultad-humanidades-ciencias-comunicacion.pdf\"
      target=\"_blank\">Tasas Acad&eacute;micas de Grado Campus Valencia CEU UCH</a></li>\r\n\t<li><a
      href=\"/docs/nuevo-alumno/tasas-academicas/grado/campus-elche.pdf\" target=\"_blank\">Tasas
      Acad&eacute;micas 1&ordm; de Grado Campus Elche CEU-UCH</a></li>\r\n\t<li><a
      href=\"/docs/nuevo-alumno/tasas-academicas/grado/campus-castellon.pdf\" target=\"_blank\">Tasas
      Acad&eacute;micas 1&ordm; de Grado Campus Castell&oacute;n CEU-UCH</a></li>\r\n</ul>\r\n\r\n<div>\r\n<div>\r\n<p><img
      alt=\"Merit Program\" src=\"/img/iconos/merit-program.png\" /></p>\r\n\r\n<h3>Becas
      CEU Merit Program</h3>\r\n\r\n<p>Bienvenido a la beca sin letra peque&ntilde;a
      <strong>para estudiantes nacionales</strong>. <a href=\"/becas-universitarias/becas-ceu-merit-program\"
      target=\"_blank\">CEU Merit Program</a> ofrece m&aacute;s de 90 becas al a&ntilde;o
      con una reducci&oacute;n del 65% o del 100% sobre el precio total por curso.
      Este es el &uacute;nico programa de becas en el que sabr&aacute;s si te conceden
      la beca antes de matricularte, as&iacute; si no te la concedemos tendr&aacute;s
      incluso tiempo para elegir otra universidad. As&iacute; de claro, sin letra
      peque&ntilde;a.</p>\r\n</div>\r\n\r\n<div>\r\n<p><img alt=\"Becas\" src=\"/img/iconos/becas.png\"
      /></p>\r\n\r\n<h3>Becas CEU Merit International Program</h3>\r\n\r\n<p>Y si
      eres <strong>estudiante internacional</strong>, tambi&eacute;n podr&aacute;s
      recibir apoyo financiero para realizar tus estudios de Grado con nosotros.<br
      />\r\nCon las becas <a href=\"/becas-universitarias/becas-merit-internacional\"
      target=\"_blank\">CEU Merit International Program</a>, podr&aacute;s acceder
      a 100 becas con las que reducir hasta el 100% las tasas acad&eacute;micas de
      tu titulaci&oacute;n.</p>\r\n</div>\r\n\r\n<div>\r\n<p><img alt=\"Becas de Colaboración\"
      src=\"/img/iconos/colaboracion.png\" /></p>\r\n\r\n<h3>Becas de Colaboraci&oacute;n</h3>\r\n\r\n<p>&iquest;Qu&eacute;
      te parecer&iacute;a la idea de <strong>cobrar por colaborar en diversas &aacute;reas
      de la Universidad</strong>?, &iquest;y si adem&aacute;s colaboras con un &aacute;rea
      que est&aacute; directamente relacionada con tu futuro profesional? En eso consisten
      las becas de colaboraci&oacute;n CEU para estudiantes <a href=\"/becas-universitarias/becas-colaboracion\"
      target=\"_blank\">nacionales</a> e <a href=\"/becas-universitarias/becas-internacionales-colaboracion\"
      target=\"_blank\">internacionales</a>. El &eacute;xito de convocatoria a&ntilde;o
      a a&ntilde;o nos demuestra que son una combinaci&oacute;n ideal de ayuda y aprendizaje.</p>\r\n</div>\r\n</div>\r\n</div>"
