    texto: "<pre>\r\n<code>&lt;div class=&quot;texto-iframe&quot; id=&quot;salidas-profesionales&quot;&gt;\r\n
      \   &lt;h2 class=&quot;title&quot;&gt;Salidas profesionales&lt;/h2&gt;\r\n    &lt;p&gt;La
      profesi&oacute;n para la que capacita el t&iacute;tulo es Maestro en Educaci&oacute;n
      Infantil. Adem&aacute;s, el titulado en Educaci&oacute;n Infantil puede desarrollar
      su actividad en los &aacute;mbitos siguientes:&lt;/p&gt;\r\n    &lt;ul class=&quot;arrow-list&quot;&gt;\r\n
      \       &lt;li&gt;Profesor centros p&uacute;blicos y privados:&lt;/li&gt;\r\n
      \       &lt;ul class=&quot;arrow-list&quot;&gt;\r\n            &lt;li&gt;Educaci&oacute;n
      Infantil&lt;/li&gt;\r\n        &lt;/ul&gt;\r\n        &lt;li&gt;Funcionario
      (Docentes de Educaci&oacute;n Infantil):&lt;/li&gt;\r\n        &lt;ul class=&quot;arrow-list&quot;&gt;\r\n
      \           &lt;li&gt;Nacional&lt;/li&gt;\r\n            &lt;li&gt;Auton&oacute;mica&lt;/li&gt;\r\n
      \           &lt;li&gt;Local&lt;/li&gt;\r\n            &lt;li&gt;Organismos Internacionales&lt;/li&gt;\r\n
      \           &lt;li&gt;Carrera Diplom&aacute;tica&lt;/li&gt;\r\n        &lt;/ul&gt;\r\n
      \       &lt;li&gt;Personal cualificado de museos y centros culturales:&lt;/li&gt;\r\n
      \       &lt;ul class=&quot;arrow-list&quot;&gt;\r\n            &lt;li&gt;Direcci&oacute;n
      educativa&lt;/li&gt;\r\n            &lt;li&gt;Mantenimiento de fondos fijos
      y renovables&lt;/li&gt;\r\n            &lt;li&gt;Exposiciones temporales&lt;/li&gt;\r\n
      \           &lt;li&gt;Gu&iacute;a personalizada y de grupos&lt;/li&gt;\r\n            &lt;li&gt;Creaci&oacute;n
      y sostenimiento de canales de intercambio&lt;/li&gt;\r\n            &lt;li&gt;Elaboraci&oacute;n
      de inventarios y creaci&oacute;n de cat&aacute;logos&lt;/li&gt;\r\n            &lt;li&gt;Intermediaci&oacute;n
      cultural&lt;/li&gt;\r\n        &lt;/ul&gt;\r\n        &lt;li&gt;Agente de servicios
      culturales:&lt;/li&gt;\r\n        &lt;ul class=&quot;arrow-list&quot;&gt;\r\n
      \           &lt;li&gt;Dise&ntilde;o de productos, instalaciones y servicios
      culturales&lt;/li&gt;\r\n            &lt;li&gt;Mediaci&oacute;n intercultural
      y cooperaci&oacute;n internacional&lt;/li&gt;\r\n            &lt;li&gt;Animaci&oacute;n
      y difusi&oacute;n cultural&lt;/li&gt;\r\n            &lt;li&gt;Sector audiovisual&lt;/li&gt;\r\n
      \           &lt;li&gt;Comisariado de exposiciones&lt;/li&gt;\r\n            &lt;li&gt;Intervenci&oacute;n
      en la rehabilitaci&oacute;n y restauraci&oacute;n del patrimonio&lt;/li&gt;\r\n
      \       &lt;/ul&gt;\r\n        &lt;li&gt;Ayuntamientos y entidades c&iacute;vicas:&lt;/li&gt;\r\n
      \       &lt;ul class=&quot;arrow-list&quot;&gt;\r\n            &lt;li&gt;Dinamizaci&oacute;n
      cultural y educativa&lt;/li&gt;\r\n            &lt;li&gt;Organizaci&oacute;n
      de proyectos y acontecimientos ciudadanos y actividades l&uacute;dicas&lt;/li&gt;\r\n
      \       &lt;/ul&gt;\r\n        &lt;li&gt;Investigador&lt;/li&gt;\r\n        &lt;ul
      class=&quot;arrow-list&quot;&gt;\r\n            &lt;li&gt;Consejo Superior de
      Investigaciones Cient&iacute;ficas&lt;/li&gt;\r\n            &lt;li&gt;Ministerio
      de Cultura&lt;/li&gt;\r\n            &lt;li&gt;Universidades&lt;/li&gt;\r\n
      \           &lt;li&gt;Fundaciones&lt;/li&gt;\r\n        &lt;/ul&gt;\r\n    &lt;/ul&gt;\r\n&lt;/div&gt;\r\n</code></pre>"
